import React, { Component } from "react";
import { GridList, Container } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <div>
        <h3 style={{ alignContent: "left" }}>Cart</h3>
        <GridList cellHeight={100} style={{}}>
          {["red", "yellow"].map(color => (
            <Container style={{ background: color }}></Container>
          ))}
        </GridList>
      </div>
    );
  }
}

export default Cart;
